var _changelog = [
    {
        "_id": 0,
        "Data": [
            {
                "Ver": "4.5v4",
                "Logs": [
                    {
                        "Name": "Uraku Misugiri",
                        "Color": "Rock",
                        "Notes": [
                            "Added Weapon Story. Also added the story of the 4-star polearm Dialogues of the Desert Sages."
                        ]
                    },
                    {
                        "Name": "Chiori",
                        "Color": "Rock",
                        "Notes": [
                            "Description changed: E's Construct triggered Sode and C2's Kinu dolls all spawn next to the active character now.",
                            "The range of detecting Geo Constructs is boosted to 30m, <b>greater than the radius of the Spiral Abyss</b>."
                        ]
                    }
                ]
            },
            {
                "Ver": "4.5v3",
                "Logs": [
                    {
                        "Name": "Uraku Misugiri",
                        "Color": "Rock",
                        "Notes": [
                            "Regardless of whether on or off field, the equipped character will always gain both Normal ATK and Elemental Skill DMG buffs."
                        ]
                    },
                    {
                        "Name": "Chiori",
                        "Color": "Rock",
                        "Notes": [
                            "<color style='color:#f29d38'>Automaton Dolls: </color>Particle generation CD 1.9s -> 3s. No longer attack animals. No longer snapshots DEF (snapshots nothing now).",
                            "<color style='color:#f29d38'>Elemental Burst: </color>DMG multiplier lowered, CD 15s -> 13.5s, energy 60 -> 50, now able to launch enemies into the air.",
                            "<color style='color:#f29d38'>C6: </color>DMG increase: 50% ATK + 180% DEF -> 235% DEF. Removed trigger limit of 5 times.",
                            "C2 / C4 switched (already present in v2 hotfix)"
                        ]
                    }
                ]
            },
            {
                "Ver": "4.5v2",
                "Logs": [
                    {
                        "Name": "Chiori",
                        "Color": "Rock",
                        "Notes": [
                            "During-plunge DMG no longer triggers or consumes C6 effect.",
                            "The Doll summoned by the creation of a Geo Construct: Spawn point changed from near the Construct to near the active character.",
                            "Doll DMG and Burst DMG changed to Blunt hits, recieving the ability to damage Geo Shields and Ores:<br>- Doll DMG shreds 0.42GU and Burst shreds 2.8GU.",
                            "For a short period of time after switching characters with the Tapestry effect, you cannot jump and will lose gravity."
                        ]
                    }
                ]
            },
            {
                "Ver": "4.5v1",
                "Logs": [
                    {
                        "Name": "Chiori",
                        "Color": "Rock",
                        "Notes": [
                            "Passive 3's Movement SPD buff does not take effect in domains and the Spiral Abyss, and does not stack with Dehya, Gaming and Rosaria's Passive buffs.",
                            "Chiori's dolls <s>do not snapshot</s> do not snapshot anything except DEF. In their 17s lifetime they can attack 5 times.",
                            "When casting her Elemental Skill, Chiori will first destroy the doll summoned by her Skill, and then summon one. The Geo construct of C1 summoned doll is unaffected. So at most 2 Automaton Doll: Sode can exist on the field.",
                            "Only Doll: Sude's Interval Slash generate Elemental Particles (<color style='color:#FFD780;'>80% chance 1x, 20% chance 2x</color>), with a 1.9s CD.<br>E dash upward thrust, Passive 1's after-switch coordinated attack and C2/C4's Simple Dolls all do not generate any particles.",
                            "Doll: Sode and Simple Doll: Kinu can attack any opponent within a <color style='color:#FFD780;'>12m(C0) | 18m(C1) radius</color>. <br>For comparison, Yae Miko's attack radius is <color style='color:#FFD780;'>12.5m(C0) | 20m(C2)</color>.<br>Note that C1 only increases the Dolls' search area and not their DMG AoE. Their DMG AoE is only slightly larger than Hyperbloom's DMG AoE and Yelan's Burst coordinate attack AoE.",
                            "All E-related DMG (Doll: Sude's Interval Slash, E dash upward thrust, Passive 1's after-switch coordinated attack, C2/C4's Simple Dolls) <color style='color:#FFD780;'>share an application ICD: all of these together can only apply 1GU Geo once every 1.9s</color>.<br>Q applies <color style='color:#FFD780;'>2GU Geo independently</color>."
                        ]
                    }
                ]
            }
        ]
    }
]

